import React, { useState, useEffect, useRef } from 'react';
import { Github, Linkedin, Mail, Phone, MapPin, ExternalLink, Code, Database, Cpu, Award, Briefcase, GraduationCap, ChevronDown, Menu, X, Send } from 'lucide-react';

const Portfolio = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [activeSection, setActiveSection] = useState('accueil');
  const [formData, setFormData] = useState({ name: '', email: '', message: '' });

  const observerRef = useRef(null);

  useEffect(() => {
    const options = {
      threshold: 0.2,
      rootMargin: '-50px'
    };

    observerRef.current = new IntersectionObserver((entries) => {
      entries.forEach(entry => {
        if (entry.isIntersecting) {
          entry.target.classList.add('animate-in');
        }
      });
    }, options);

    document.querySelectorAll('.fade-in-section').forEach(el => {
      observerRef.current.observe(el);
    });

    const handleScroll = () => {
      const sections = ['accueil', 'apropos', 'experiences', 'projets', 'competences', 'contact'];
      const current = sections.find(section => {
        const element = document.getElementById(section);
        if (element) {
          const rect = element.getBoundingClientRect();
          return rect.top <= 100 && rect.bottom >= 100;
        }
        return false;
      });
      if (current) setActiveSection(current);
    };

    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
      if (observerRef.current) observerRef.current.disconnect();
    };
  }, []);

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth', block: 'start' });
      setIsMenuOpen(false);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    window.location.href = `mailto:antamaguettefaye@gmail.com?subject=Contact depuis Portfolio - ${formData.name}&body=${formData.message}%0D%0A%0D%0AEmail: ${formData.email}`;
  };

  const projects = [
    {
      title: "Logiciel de Facturation Électronique",
      period: "Avril - Juillet 2025",
      company: "NORD-SUD Technology",
      description: "Système complet de facturation électronique avec gestion des commandes, génération automatique de factures (proforma & finales), bons de commande/livraison.",
      features: ["Gestion des commandes", "Génération factures proforma", "Paiement intégré", "Orange Money & PayPal", "Agile/Scrum"],
      tech: ["Symfony", "MySQL"]
    },
    {
      title: "Gestion Intelligente des Déchets Urbains",
      period: "2024-2025",
      description: "Système de surveillance en temps réel des bacs à déchets avec capteurs connectés et plateforme web pour optimiser la collecte à Dakar.",
      features: ["Capteurs à ultrasons HC-SR04", "Dashboard temps réel", "Notifications automatiques", "RFID pour gardiens", "Géolocalisation alertes", "Optimisation itinéraires"],
      tech: ["Node.js", "Angular", "MongoDB", "Arduino", "WebSocket"]
    },
    {
      title: "Système d'Arrosage Intelligent",
      period: "2024-2025",
      description: "Solution automatisée pour pépinière avec contrôle via interface web et programmation selon catégorie de plantes.",
      features: ["Authentification RFID", "Arrosage manuel via web", "Programmation automatique", "Surveillance temps réel", "CRUD utilisateurs"],
      tech: ["Raspberry Pi", "Node.js", "Angular", "MongoDB", "Laravel", "RFID"]
    },
    {
      title: "Système de Pointage Intelligent",
      period: "2024-2025",
      description: "Solution complète de gestion de pointage avec ouverture de porte automatique par carte RFID pour employés et apprenants.",
      features: ["Pointage RFID + ouverture auto", "Enregistrement pointages", "Validation photo vigile", "Gestion départements", "Import CSV", "Historique absences"],
      tech: ["Node.js", "Angular", "MongoDB", "RFID", "Arduino", "WebSocket"]
    },
    {
      title: "Contrôle Température & Humidité",
      period: "2024-2025",
      description: "Système de surveillance pour magasin de stockage avec déclenchement automatique de ventilation et alertes.",
      features: ["Collecte auto 3x/jour", "Ventilation auto si T>27°C", "Affichage LCD + web", "Dashboard admin", "Historique hebdomadaire", "Images dynamiques"],
      tech: ["Node.js", "MongoDB", "Arduino", "DHT Sensor", "WebSocket"]
    },
    {
      title: "MiniBank - Plateforme de Transaction",
      period: "2024-2025",
      description: "Application web sécurisée de gestion de transactions financières avec système de distributeurs et QR codes.",
      features: ["Comptes clients/distributeurs", "QR code transactions", "Transferts sécurisés (2% frais)", "Commission distributeurs (1%)", "Dépôts/retraits", "Annulation transactions"],
      tech: ["Laravel", "MySQL"]
    },
    {
      title: "École de la Réussite",
      period: "2024-2025",
      description: "Plateforme complète de gestion scolaire pour 10 000+ élèves avec inscriptions, paiements et suivi des présences.",
      features: ["Gestion inscriptions", "Système de paiement", "Frais inscription/mensualités", "Module paie", "Comptabilité"],
      tech: ["PHP (MVC)", "JavaScript", "MySQL", "Bootstrap"]
    }
  ];

  const experiences = [
    {
      title: "Développeuse Full-Stack",
      company: "NORD-SUD Technology",
      period: "Avril - Juillet 2025",
      description: "Développement d'un logiciel de facturation électronique avec intégration de paiements (Orange Money, PayPal). Travail en équipe Agile/Scrum.",
      icon: <Briefcase className="w-6 h-6" />
    },
    {
      title: "Développeuse Full-Stack",
      company: "Simplon Sénégal",
      period: "Juillet 2024 - Mars 2025",
      description: "Développement de multiples projets web et IoT : gestion scolaire, système bancaire, arrosage intelligent, gestion des déchets.",
      icon: <Code className="w-6 h-6" />
    },
    {
      title: "Technicienne Sécurité Électronique",
      company: "Netsysteme Informatique",
      period: "Décembre 2023 - Avril 2024",
      description: "Installation, configuration et maintenance de systèmes de surveillance (caméras de sécurité).",
      icon: <Cpu className="w-6 h-6" />
    }
  ];

  const skills = {
    frontend: ["HTML5", "CSS3", "JavaScript", "Angular", "React", "Bootstrap", "Tailwind CSS"],
    backend: ["Node.js", "Express", "PHP", "Laravel", "Symfony", "API REST", "WebSocket", "MongoDB", "MySQL", "SQL"],
    iot: ["Arduino", "Raspberry Pi", "ESP32", "DHT Sensor", "HC-SR04", "Capteurs Sol", "RFID", "Servomoteurs"],
    outils: ["Git/GitHub", "Trello", "Slack", "VS Code", "Agile/Scrum", "UML"]
  };

  return (
    <div className="min-h-screen bg-slate-900 text-white">
      <style>{`
        @keyframes fadeInUp {
          from {
            opacity: 0;
            transform: translateY(30px);
          }
          to {
            opacity: 1;
            transform: translateY(0);
          }
        }

        @keyframes fadeInLeft {
          from {
            opacity: 0;
            transform: translateX(-30px);
          }
          to {
            opacity: 1;
            transform: translateX(0);
          }
        }

        @keyframes fadeInRight {
          from {
            opacity: 0;
            transform: translateX(30px);
          }
          to {
            opacity: 1;
            transform: translateX(0);
          }
        }

        .fade-in-section {
          opacity: 0;
          transform: translateY(30px);
          transition: opacity 0.8s ease-out, transform 0.8s ease-out;
        }

        .fade-in-section.animate-in {
          opacity: 1;
          transform: translateY(0);
        }

        .stagger-1 { transition-delay: 0.1s; }
        .stagger-2 { transition-delay: 0.2s; }
        .stagger-3 { transition-delay: 0.3s; }
        .stagger-4 { transition-delay: 0.4s; }
        .stagger-5 { transition-delay: 0.5s; }
        .stagger-6 { transition-delay: 0.6s; }

        .glass {
          background: rgba(255, 255, 255, 0.03);
          backdrop-filter: blur(10px);
          border: 1px solid rgba(255, 255, 255, 0.08);
        }

        .hover-lift {
          transition: transform 0.3s ease, box-shadow 0.3s ease;
        }

        .hover-lift:hover {
          transform: translateY(-5px);
          box-shadow: 0 20px 40px rgba(0, 0, 0, 0.4);
        }

        .accent-gradient {
          background: linear-gradient(135deg, #64748b 0%, #475569 100%);
        }

        @keyframes float {
          0%, 100% { transform: translateY(0px); }
          50% { transform: translateY(-20px); }
        }

        .float {
          animation: float 6s ease-in-out infinite;
        }
      `}</style>

      {/* Navigation */}
      <nav className="fixed top-0 w-full z-50 glass">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex items-center justify-between h-16">
            <div className="flex items-center">
              <span className="text-2xl font-bold text-slate-300">AF</span>
            </div>

            <div className="hidden md:block">
              <div className="flex items-center space-x-8">
                {['Accueil', 'À Propos', 'Expériences', 'Projets', 'Compétences', 'Contact'].map((item) => (
                  <button
                    key={item}
                    onClick={() => scrollToSection(item.toLowerCase().replace('à ', 'a'))}
                    className={`hover:text-slate-300 transition-colors ${
                      activeSection === item.toLowerCase().replace('à ', 'a') ? 'text-slate-300' : 'text-slate-400'
                    }`}
                  >
                    {item}
                  </button>
                ))}
              </div>
            </div>

            <button
              className="md:hidden text-slate-300"
              onClick={() => setIsMenuOpen(!isMenuOpen)}
            >
              {isMenuOpen ? <X /> : <Menu />}
            </button>
          </div>
        </div>

        {isMenuOpen && (
          <div className="md:hidden glass">
            <div className="px-2 pt-2 pb-3 space-y-1">
              {['Accueil', 'À Propos', 'Expériences', 'Projets', 'Compétences', 'Contact'].map((item) => (
                <button
                  key={item}
                  onClick={() => scrollToSection(item.toLowerCase().replace('à ', 'a'))}
                  className="block w-full text-left px-3 py-2 hover:bg-slate-800/50 rounded-md text-slate-300"
                >
                  {item}
                </button>
              ))}
            </div>
          </div>
        )}
      </nav>

      {/* Hero Section */}
      <section id="accueil" className="min-h-screen flex items-center justify-center px-4 pt-16">
        <div className="max-w-4xl mx-auto text-center">
          <div className="fade-in-section stagger-1">
            <h1 className="text-5xl md:text-7xl font-bold mb-4 text-slate-100">
              Anta Maguette Faye
            </h1>
          </div>
          <div className="fade-in-section stagger-2">
            <h2 className="text-2xl md:text-3xl text-slate-400 mb-6">
              Développeuse Web Full Stack & IoT
            </h2>
          </div>
          <div className="fade-in-section stagger-3">
            <p className="text-lg md:text-xl text-slate-400 mb-8 max-w-2xl mx-auto">
              Passionnée par la création d'applications modernes et performantes, avec une double compétence en électronique et développement
            </p>
          </div>
          <div className="fade-in-section stagger-4 flex flex-wrap justify-center gap-4">
            <button
              onClick={() => scrollToSection('contact')}
              className="bg-slate-700 hover:bg-slate-600 px-8 py-3 rounded-lg font-semibold transition-all hover:scale-105"
            >
              Me Contacter
            </button>
            <a
              href="https://github.com/antamaguettefaye"
              target="_blank"
              rel="noopener noreferrer"
              className="glass px-8 py-3 rounded-lg font-semibold flex items-center gap-2 hover:bg-slate-800/50 transition-all"
            >
              <Github size={20} />
              GitHub
            </a>
            <a
              href="https://www.linkedin.com/in/anta-maguette-faye-10693b244/"
              target="_blank"
              rel="noopener noreferrer"
              className="glass px-8 py-3 rounded-lg font-semibold flex items-center gap-2 hover:bg-slate-800/50 transition-all"
            >
              <Linkedin size={20} />
              LinkedIn
            </a>
          </div>
          <div className="mt-12 animate-bounce">
            <ChevronDown size={32} className="mx-auto text-slate-500" />
          </div>
        </div>
      </section>

      {/* À Propos */}
      <section id="apropos" className="py-20 px-4">
        <div className="max-w-6xl mx-auto">
          <div className="fade-in-section">
            <h2 className="text-4xl md:text-5xl font-bold mb-12 text-center text-slate-200">
              À Propos de Moi
            </h2>
          </div>

          <div className="grid md:grid-cols-2 gap-8">
            <div className="fade-in-section stagger-1 glass p-8 rounded-xl hover-lift">
              <h3 className="text-2xl font-bold mb-4 flex items-center gap-3 text-slate-200">
                <Award className="text-slate-400" />
                Profil
              </h3>
              <p className="text-slate-400 leading-relaxed">
                Développeuse web full-stack polyvalente avec une expertise unique alliant développement logiciel et électronique. Diplômée de Simplon Sénégal en développement Full Stack & IoT, j'ai également un BTS en Électronique Industrielle.
              </p>
              <p className="text-slate-400 leading-relaxed mt-4">
                Mon approche combine créativité technique et rigueur professionnelle pour concevoir des solutions innovantes qui répondent aux besoins réels des utilisateurs.
              </p>
            </div>

            <div className="space-y-6">
              <div className="fade-in-section stagger-2 glass p-6 rounded-xl hover-lift">
                <div className="flex items-start gap-4">
                  <GraduationCap className="text-slate-400 mt-1" size={24} />
                  <div>
                    <h4 className="text-xl font-bold mb-2 text-slate-200">Développement Full Stack & IoT</h4>
                    <p className="text-slate-400">Simplon Sénégal</p>
                    <p className="text-slate-500 text-sm">Juillet 2024 - Mars 2025</p>
                  </div>
                </div>
              </div>

              <div className="fade-in-section stagger-3 glass p-6 rounded-xl hover-lift">
                <div className="flex items-start gap-4">
                  <GraduationCap className="text-slate-400 mt-1" size={24} />
                  <div>
                    <h4 className="text-xl font-bold mb-2 text-slate-200">BTS Électronique Industrielle</h4>
                    <p className="text-slate-400">CEDT LE G15</p>
                    <p className="text-slate-500 text-sm">2022 - Mention Assez Bien</p>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* Expériences */}
      <section id="experiences" className="py-20 px-4 bg-slate-950">
        <div className="max-w-6xl mx-auto">
          <div className="fade-in-section">
            <h2 className="text-4xl md:text-5xl font-bold mb-12 text-center text-slate-200">
              Expériences Professionnelles
            </h2>
          </div>

          <div className="space-y-8">
            {experiences.map((exp, index) => (
              <div
                key={index}
                className={`fade-in-section stagger-${index + 1} glass p-8 rounded-xl hover-lift`}
              >
                <div className="flex items-start gap-4">
                  <div className="bg-slate-700 p-3 rounded-xl">
                    {exp.icon}
                  </div>
                  <div className="flex-1">
                    <h3 className="text-2xl font-bold mb-2 text-slate-200">{exp.title}</h3>
                    <p className="text-slate-400 font-semibold mb-1">{exp.company}</p>
                    <p className="text-slate-500 text-sm mb-3">{exp.period}</p>
                    <p className="text-slate-400 leading-relaxed">{exp.description}</p>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Projets */}
      <section id="projets" className="py-20 px-4">
        <div className="max-w-7xl mx-auto">
          <div className="fade-in-section">
            <h2 className="text-4xl md:text-5xl font-bold mb-4 text-center text-slate-200">
              Mes Projets
            </h2>
            <p className="text-center text-slate-400 mb-12">
              Découvrez mes réalisations en développement web et IoT
            </p>
          </div>

          <div className="grid md:grid-cols-2 gap-8">
            {projects.map((project, index) => (
              <div
                key={index}
                className={`fade-in-section stagger-${(index % 3) + 1} glass rounded-xl overflow-hidden hover-lift`}
              >
                <div className="h-1 bg-slate-600"></div>
                <div className="p-6">
                  <div className="flex justify-between items-start mb-4">
                    <h3 className="text-xl font-bold text-slate-200">{project.title}</h3>
                    <span className="text-xs text-slate-500 whitespace-nowrap ml-2">{project.period}</span>
                  </div>

                  {project.company && (
                    <p className="text-slate-400 text-sm mb-3">{project.company}</p>
                  )}

                  <p className="text-slate-400 mb-4 text-sm leading-relaxed">{project.description}</p>

                  <div className="mb-4">
                    <h4 className="text-sm font-semibold mb-2 text-slate-300">Fonctionnalités clés :</h4>
                    <div className="flex flex-wrap gap-2">
                      {project.features.slice(0, 4).map((feature, i) => (
                        <span key={i} className="text-xs bg-slate-800 px-2 py-1 rounded text-slate-400">
                          {feature}
